import Category from '../components/category/category';
import Hero from '../components/hero/hero';

export default function Home() {
	const category = [
		{
			name: 'Classic Spring',
			price: '$120.00',
			rating: 5,
			imgSrc: '/assets/images/card-1.jpg',
		},
	];
	return (
		<div className='home'>
			<Hero />
			<Category category={category} />
		</div>
	);
}
